import React, { Component } from "react";
import './Dropdown.css'

class Dropdown extends Component {
    state = {
        click: false
    }
    handleClick = () => {
        const {click} = this.state
        this.seState({click: !click})
    }
    render() {
        return (
            <ul
                onClick={handleClick}
                className={click ? 'dropdown-menu.clicked' : 'dropdown-menu'}>
                <li>Dropdown</li>
            </ul>
        )
    }
}

export default Dropdown
